import React, { useState } from "react";
import axios from "axios";
import "./Signup.css";
import { Link } from "react-router-dom";
import Input from "../components/Input";
import { Button } from "../components/Button";
import { useForm } from "react-hook-form";
import Api from "../components/config/Api";

const Signup = () => {
  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm;
  const onSubmit = (e) => {
    Api.post("post", {
      firstname: e.firstname,
      lastname: e.lastname,
      email: e.email,
      password: e.password,
    });
  };

  return (
    <div className="Signup">
      <h1> SIGN UP</h1>
      <Link className="Link" to="/">
        <h2 className="sign"> Login</h2>
      </Link>
      <form onSubmit={handleSubmit(onSubmit)}>
        <div className="flex">
          <div className="in">
            <Input place="First name" />
          </div>
          <div className="put">
            <Input place="Last Name" />
          </div>
        </div>

        <Input className="input" place="Email" />

        <Input className="input" type="password" place="Password" />

        <Input type="password" place="Confirm Password" />

        <Button />
      </form>
    </div>
  );
};

export default Signup;
